import React from "react";
import { Link } from "react-router-dom";

const Card = ({ image, name, temperament, weight, id }) => {
  return (
    <div>
      <Link to={"/dog/" + id}>
        <img src={image} alt="img not found" width="200px" height="250px" />
      </Link>
      <h3>{name}</h3>
      <h5>
        {temperament}
        {el.temperament
          ? el.temperament
          : el.temperaments?.map((ele, index) =>
              el.temperaments.length - 1 === index ? ele.name : ele.name + ", "
            )}
      </h5>
      <h5>{weight}</h5>
    </div>
  );
};

export default Card;

